import react from "react";
import Chart from "../Chart/Chart";

function ExpensesChart(){
    const charDataPoints =[
        {label: "styczeń", value: 0},
        {label: "luty", value: 0},
        {label: "marzec", value: 0},
        {label: "kwiecień", value: 0},
        {label: "maj", value: 0},
        {label: "czerwiec", value: 0},
        {label: "lipiec", value: 0},
        {label: "sierpień", value: 0},
        {label: "wrzesień", value: 0},
        {label: "październik", value: 0},
        {label: "listopad", value: 0},
        {label: "grudzień", value: 0},
    ]
    
    for(const expense in props.expense){
        const expenseMonth = expense.date.getMonth();
        charDataPoints[expenseMonth].value += expense.amount;
    }

    return <Chart dataPoints={charDataPoints}/>;
    
}

export default ExpensesChart;
